import {  Typography, Box, SvgIcon } from "@mui/material";
import navlogo from '../../assets/nav.png';
import styles from "./Navbar.module.scss";

const Navbar = () => {
  return (
    <nav className={styles.navbar}>
      <img src={navlogo} alt="navbar-icon" />
      <Typography sx={{ fontWeight: "bold" }}> Weather Forecast</Typography>
      </nav>
  );
};

export default Navbar;
